import React, { useState } from "react";
import axios from "axios";

const TransactionForm = ({ fetchTransactions }) => {
  const [formData, setFormData] = useState({
    amount: "",
    category: "",
    type: "expense",
    description: "",
  });
  const [error, setError] = useState("");

  const expenseCategories = [
    "Food",
    "Transport",
    "Shopping",
    "Bills",
    "Entertainment",
    "Other",
  ];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
    setError("");
  };

  const validateForm = () => {
    if (!formData.amount || formData.amount <= 0) {
      setError("Please enter a valid amount");
      return false;
    }
    if (formData.type === "expense" && !formData.category) {
      setError("Please select a category for expense");
      return false;
    }
    return true;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validateForm()) return;

    try {
      const transactionData = {
        ...formData,
        amount: Number(formData.amount),
        category: formData.type === "income" ? "Income" : formData.category,
      };

      await axios.post(
        "http://localhost:5000/api/transactions",
        transactionData
      );
      setFormData({
        amount: "",
        category: "",
        type: "expense",
        description: "",
      });
      fetchTransactions();
    } catch (error) {
      setError("Failed to add transaction. Please try again.");
      console.error("Error adding transaction:", error);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="transaction-form">
      <h2>Add New Transaction</h2>
      {error && <div className="error-message">{error}</div>}

      <div className="form-group">
        <label>Type</label>
        <div className="type-selector">
          <button
            type="button"
            className={`type-btn ${
              formData.type === "expense" ? "active" : ""
            }`}
            onClick={() =>
              setFormData({
                ...formData,
                type: "expense",
                category: "",
                description: "",
              })
            }
          >
            Expense
          </button>
          <button
            type="button"
            className={`type-btn ${formData.type === "income" ? "active" : ""}`}
            onClick={() =>
              setFormData({
                ...formData,
                type: "income",
                category: "",
                description: "",
              })
            }
          >
            Income
          </button>
        </div>
      </div>

      <div className="form-group">
        <label>Amount (â‚¹)</label>
        <input
          type="number"
          name="amount"
          value={formData.amount}
          onChange={handleChange}
          placeholder={`Enter ${formData.type} amount`}
          min="0"
          step="0.01"
        />
      </div>

      {formData.type === "expense" && (
        <>
          <div className="form-group">
            <label>Category</label>
            <select
              name="category"
              value={formData.category}
              onChange={handleChange}
              required
            >
              <option value="">Select a category</option>
              {expenseCategories.map((category) => (
                <option key={category} value={category}>
                  {category}
                </option>
              ))}
            </select>
          </div>

          <div className="form-group">
            <label>Description (Optional)</label>
            <input
              type="text"
              name="description"
              value={formData.description}
              onChange={handleChange}
              placeholder="Add a description"
            />
          </div>
        </>
      )}

      <button type="submit" className="submit-btn">
        Add {formData.type === "income" ? "Income" : "Expense"}
      </button>
    </form>
  );
};

export default TransactionForm;
